function AnalistCircle() {
  return (
    <section className="analist-diagram">
      <header className="analist-diagram--header">
        <Text className="analist-header--title">Analist</Text>
        <p className="analist-header--search">search</p>
      </header>
      <div className="analist-circle--container">
        <div className="analist-circle"></div>
      </div>
    </section>
  );
}
export default AnalistCircle;
